package bruteforce

import "fmt"

func lengthOfLongestSubstring(s string) int {
	var longest int
	for i := range s {
		for j := i + 1; j <= len(s); j++ {
			if j-i <= longest {
				continue
			}
			m := make(map[rune]int)
			flag := true
			substr := s[i:j]
			for _, c := range substr {
				if _, ok := m[c]; ok {
					flag = false
					break
				}
				m[c] = 1
			}
			if flag {
				if j-i > longest {
					longest = j - i
				}
			}
		}
	}

	return longest
}

